sourcesContent:
import { response } from 'express';
import Product from '../models/Product';

// Función para obtener todos los productos
export const getProducts = async (req, res) => {
    try {
        const products = await Product.find(); // Buscar todos los productos en la base de datos
        res.json(products);  // Enviar el array de productos como respuesta
    } catch (error) {
        res.status(500).json({ message: error.message }); // Enviar un mensaje de error si ocurre algún problema en el servidor
    }
}

// Función para crear un nuevo producto
export const createProduct = async (req, res) => {
    try {
        const { name, price, category, imgURL } = req.body; // Obtener los datos del nuevo producto desde el cuerpo de la solicitud
        const newProduct = new Product({ name, price, category, imgURL }); // Crear una nueva instancia de producto con los datos proporcionados
        const productSave = await newProduct.save(); // Guardar el nuevo producto en la base de datos

        res.status(201).json({ message: "Producto guardado" }); // Enviar un mensaje de éxito como respuesta
        //res.status(201).json(productSave);  // Si se desea enviar el producto guardado como respuesta
    } catch (error) {
        res.status(500).json({ message: error.message }); // Enviar un mensaje de error si ocurre algún problema en el servidor
    }
}


// Función para obtener un producto por su ID
export const getProductById = async (req, res) => {
    try {
        const productId = req.params.productId; // Obtener el ID del producto desde los parámetros de la URL
        const product = await Product.findById(productId); // Buscar el producto por su ID en la base de datos

        if (!product) {
            return res.status(404).json({ message: 'Producto no encontrado' }); // Enviar un mensaje de error si el producto no se encuentra
        }

        res.json(product); // Enviar el producto encontrado como respuesta
    } catch (error) {
        res.status(500).json({ message: error.message }); // Enviar un mensaje de error si ocurre algún problema en el servidor
    }
}

// Función para actualizar un producto por su ID
export const updateProductById = async (req, res) => {
    try {
        const productId = req.params.productId; // Obtener el ID del producto desde los parámetros de la URL
        const { name, price, category, imgURL } = req.body; // Obtener los datos actualizados del producto desde el cuerpo de la solicitud

        const updatedProduct = await Product.findByIdAndUpdate(
            productId,
            { name, price, category, imgURL },
            { new: true } // Para obtener el producto actualizado
        );

        if (!updatedProduct) {
            return res.status(404).json({ message: 'Producto no encontrado' }); // Enviar un mensaje de error si el producto no se encuentra
        }

        res.status(201).json({ message: "Cambios aplicados al producto" }); // Enviar un mensaje de éxito como respuesta
    } catch (error) {
        res.status(500).json({ message: error.message }); // Enviar un mensaje de error si ocurre algún problema en el servidor
    }
}

// Función para eliminar un producto por su ID
export const deleteProductById = async (req, res) => {
    try {
        const productId = req.params.productId; // Obtener el ID del producto desde los parámetros de la URL

        const deletedProduct = await Product.findByIdAndDelete(productId); // Eliminar el producto de la base de datos

        if (!deletedProduct) {
            return res.status(404).json({ message: 'Producto no encontrado' }); // Enviar un mensaje de error si el producto no se encuentra
        }

        res.json({ message: 'Producto eliminado exitosamente' }); // Enviar un mensaje de éxito como respuesta
    } catch (error) {
        res.status(500).json({ message: error.message }); // Enviar un mensaje de error si ocurre algún problema en el servidor
    }
}

